import React, { Component, PropTypes } from 'react';

import axios from 'axios';

import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';

class Home extends Component {
    constructor(props) {
        super(props);

    }
    state={
        top5:null,
        profile:null
    };
    componentDidMount(){
        axios.get('/getCounts').then(res=>{
            console.log(res);
            this.setState({
                top5:res.data
            })
        }).catch(err=>{
            console.log(err)
        })
    }


    render() {
        const top5_=this.state.top5.map(state_data=>
            <div key={state_data.States}>
        <Card variant="outlined" className="margin10">
            <CardContent>{state_data.Cured}</CardContent>
            <CardContent>{state_data.Cured}</CardContent>
            <CardActions>{state_data.Cured}</CardActions>
        </Card>
        </div>

        );
        return (
            <div>
                {top5_}
            </div>
        );
    }
}

Home.propTypes = {

};

export default Home;
